(77, '2022051005', 58, 35, 31, NULL, 'Alta', 'IP 10.46.204.134.\r\nNo acesso ao SisBol, quando vai lançar uma nota ao selecionar a Estrutura da nota dentro do Boletim o sistema não atualiza os assuntos gerais e específicos para que gere o  Texto de Abertura e Texto de fechamento impossibilitando a confecção da Nota para Boletim selecionada. Fato isto exposto solicito verificar a última atualização para o Navegador FireFox, Chrome e/ou Internet Explorer para Windows, tendo em vista que outros computadores da SFPC realizam o lançamento da nota sem problemas.', 'erro sisbol.jpg', , 'image/jpeg', 219415, NULL, '2º Sgt Vagner', 'Resolvido', 'Sd EP lins', '10.46.204.134', '2022-05-10 14:37:48', 'sfpc', '2022-05-26 09:47:37', 'lins');
