INSERT INTO `incidentes` (`id_incidente`, `incidente`, `dica`, `cor`, `ip`, `equipamento`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(18, 'Cadastro de usuário no SPED', 'Informar nome completo do militar, nome de guerra, posto/graduação e função publicada em BI.', '#73d216', NULL, NULL, '2022-03-25 10:15:55', 'admin', '2022-07-22 11:14:46', 'cleyton'),
(19, 'Troca de senha SPED', 'Após o reset da senha, o militar deverá trocar a senha para uma senha forte.', NULL, 0, NULL, '2022-03-25 10:16:07', 'admin', '2022-04-01 08:56:25', 'cleyton'),
(20, 'Passagem de função SPED', 'O militar poderá associar de forma temporária a própria conta. Somente abra este chamado se a conta necessitar ser associada de forma permanente.', '#729fcf', NULL, NULL, '2022-03-25 10:16:22', 'admin', '2022-06-17 08:47:37', 'cleyton'),
(21, 'Ajustar data/hora do computador', 'Este incidente será resolvido de forma remota. Favor manter a máquina ligada e não esquecer de enviar o IP da mesma.', NULL, 1, 1, '2022-03-25 10:16:59', 'admin', '2022-03-31 21:47:34', 'cleyton'),
(22, 'Acesso ao servidor de arquivos (pasta público)', 'Informar corretamente o IP da máquina para que este chamado seja resolvido de forma remota.', '#fcaf3e', 1, 1, '2022-03-25 10:17:35', 'admin', '2022-06-06 11:19:33', 'cleyton'),
(23, 'Criação de conta e-mail 7º GAC', 'A conta de e-mail funcional do zimbra do 7º GAC, é destinada para a seção, e não para o militar. Caso deseje uma conta com domínio .eb.mil.br, o militar poderá criar uma usando o link Eb Mail disponível na nossa Intranet.', NULL, NULL, NULL, '2022-03-25 10:19:22', 'admin', '2022-03-31 21:53:09', 'cleyton'),
(24, 'Troca de senha webmail 7º GAC', 'Enviar o o login usado ou nome do email para troca de senha. Ex: sti@7gac.eb.mil.br', NULL, NULL, NULL, '2022-03-25 10:19:45', 'admin', '2022-03-31 22:00:58', 'cleyton'),
(25, 'Manutenção de impressora', 'Informar a localização da impressora. Na maioria dos casos este chamado pode ser resolvido de forma remota.', '#8ae234', 0, 1, '2022-03-25 10:20:56', 'admin', '2022-04-30 06:32:33', 'cleyton'),
(26, 'Configuração de impressora', 'Informar a localização da impressora. Na maioria dos casos este chamado pode ser resolvido de forma remota.', '#fcaf3e', 1, 1, '2022-03-25 10:21:12', 'admin', '2022-04-30 06:32:11', 'cleyton'),
(27, 'Aumento de quota na pasta da seção', 'Caso não esteja conseguindo gravar arquivos na pasta da sua seção, o militar deverá justificar o aumento de espaço que está solicitando para a mesma.', NULL, NULL, NULL, '2022-03-25 10:24:18', 'admin', '2022-04-01 08:25:53', 'cleyton'),
(28, 'Instalação do Siscofis', 'Este incidente poderá ser resolvido de forma remota. Conferir o campo IP logo abaixo. Caso o chamado seja para outro PC, enviar o IP da máquina que necessita de atualização do SISCOFIS.', NULL, 1, 1, '2022-03-25 10:26:11', 'admin', '2022-04-01 08:59:57', 'cleyton'),
(29, 'Atualização do Siscofis', 'Este incidente poderá ser resolvido de forma remota. Conferir o campo IP logo abaixo. Caso o chamado seja para outro PC, enviar o IP da máquina que necessita de atualização do SISCOFIS.', '#ef2929', 1, 1, '2022-03-25 10:26:22', 'admin', '2022-04-30 06:31:49', 'cleyton'),
(30, 'Cadastro de computador particular na rede interna do grupo', 'Esta não é uma prática recomendada, porém caso seja autorizada pelo Scmt do grupo, o militar deverá concordar que sejam instalados softwares de monitoramento em seu PC, e demais que a STI julgar necessário, bem como bloqueio de pen drive para mitigar a proliferação de vírus na rede interna, o que torna a rede mais lenta. O usuário também deverá informar se irá utilizar a rede através de um cabo de rede ou wi-fi.', '#0275d8', NULL, NULL, '2022-03-25 10:28:10', 'admin', '2022-05-03 13:23:19', 'cleyton'),
(31, 'Publicação de matéria na página de Internet', 'Para publicação de matéria na página de internet, o militar deverá procurar a ComSoc do 7º GAC, caso não obtenha sucesso, o militar poderá solicitar à STI.', NULL, NULL, NULL, '2022-03-25 10:28:52', 'admin', '2022-04-01 08:46:37', 'cleyton'),
(32, 'Publicação de matéria na página de Intranet', 'Qualquer seção poderá solicitar  a publicação de matéria na Intranet do Grupo. Lembrar de enviar a matéria por completo para q a STI realize a publicação.', NULL, NULL, 0, '2022-03-25 10:29:57', 'admin', '2022-04-01 08:49:16', 'cleyton'),
(33, 'Fornecimento de material de TI', 'O Fornecimento de material de TI está condicionado ao estoque disponível na STI.', NULL, NULL, 1, '2022-03-25 10:30:23', 'admin', '2022-04-01 08:31:19', 'cleyton'),
(34, 'Manutenção de Micro', 'Descrever o incidente de forma detalhada, se for o caso, poderá enviar uma foto da tela caso esteja aparecendo alguma mensagem.', '#ad7fa8', NULL, 1, '2022-03-25 10:31:01', 'admin', '2022-04-30 06:33:27', 'cleyton'),
(35, 'Instalação de Software', 'Informar o IP da máquina para tal solicitação. A instalação será feita de forma remota. Se o chamado for para esta máquina, seu IP já está disponível no campo abaixo, bastando apenas confirmar.', '#888a85', 1, 1, '2022-03-25 10:32:34', 'admin', '2022-06-17 08:48:16', 'cleyton'),
(36, 'Instalação e configuração de VPN', 'Após abrir o chamado, o militar deverá trazer o seu PC na STI, para que seja instalado e configurado a VPN.', '#fce94f', NULL, NULL, '2022-03-25 10:33:32', 'admin', '2022-04-30 06:32:20', 'cleyton'),
(37, 'Criação de conta de acesso a Internet', 'Para criação de conta de acesso a internet, o militar deverá fornecer posto/grad, nome de guerra e nome completo, para que seja efetuado o cadastro no proxy do 5º CTA.', NULL, NULL, NULL, '2022-03-25 10:35:31', 'admin', '2022-04-01 08:47:38', 'cleyton'),
(38, 'Acesso irrestrito a Internet ', 'Para solicitar o acesso irrestrito à internet, o militar deverá fazer a solicitação ao Scmt do Grupo via DIEx, contendo as seguintes informações: posto/graduação; nome completo; função; identidade; e conta.', '#ef2929', NULL, NULL, '2022-03-25 10:36:24', 'admin', '2022-06-06 11:18:36', 'cleyton'),
(39, 'Instalação de ponto de rede', 'Para solicitar instalação de um novo ponto de rede, informar em média a distância total e o motivo para tal instalação.', NULL, NULL, NULL, '2022-03-25 10:38:15', 'admin', '2022-04-01 08:54:00', 'cleyton'),
